import React,{useEffect,useState} from 'react'
import axios from 'axios'

export default function InfinityScroll(pageNumber) {
    useEffect(() =>{
        axios({
            method:'GET',
            url: 'http://localhost:5000/inventory',
            params:pageNumber
        })
        .then(res => {
            console.log(res.data)
        })
    },[pageNumber])
    return null
}
